    aboutToBeDeleted() {
        this.__progressValue.aboutToBeDeleted();
        this.__stepGoal.aboutToBeDeleted();
        SubscriberManager.Get().delete(this.id__());
        this.aboutToBeDeletedInternal();
    }
    get progressValue() {
        return this.__progressValue.get();
